// Import All vito component here...
import Loader from './loader';

import ApexChart from './chartStyle/apexChart';
import ApexLiveChart from './chartStyle/apexLiveChart';

import SideBarStyle1 from './sidebar/SideBarStyle1';
import MenuListStyle1 from './menu/ListStyle1';

import NavBarStyle1 from './navbar/NavBarStyle1';
import BreadCrumbStyle1 from './breadCrumb/BreadCrumbStyle1';

// Lottie
import Lottie from './lottie';

// Details panel..
import DetailsPanel from './DetailsPanel';
import PanelContent from './PanelContent';

import UserDetailCard from './cardStyle/UserDetailCard';
import ChatMessage from './chat/ChatMessage';
import TimeLineCard from  './cardStyle/TimeLineCard';

// Table Style
import TableStyle from './tableStyle/tableStyle';

// List Style
import ListStyle1 from './listStyle/listStyle1';
import ListStyle2 from './listStyle/listStyle2';
import EmailListItem from './mail/EmailListItem';

// SlickSlider Style
import SlickSliderStyle1 from './slickSlider/slickSliderStyle1'

// Footer style
import FooterStyle1 from './footer/FooterStyle1';

// Timeline Style
import TimelineStyle1 from './timelineStyle/timelineStyle1';

import NotificationStyle from './elements/NotificationStyle';
import VideoStyle from './elements/VideoStyle';
// Form componets...
import ComposeEmailForm from './mail/ComposeEmailForm';

// Chat components...
import ChatItem from './chat/ChatItem';

// Export all vito components...
export {
    Loader,

    // Chart
    ApexChart,
    ApexLiveChart,

    SideBarStyle1,
    MenuListStyle1,
    NavBarStyle1,
    BreadCrumbStyle1,

    // Lottie
    Lottie,

    // Details panel
    DetailsPanel,
    PanelContent,

    // Footer
    FooterStyle1,

    UserDetailCard,
    TimeLineCard,

    // TableStyle
    TableStyle,

    // ListStyle1
    ListStyle1,
    ListStyle2,
    EmailListItem,

    // SlickSliderStyle
    SlickSliderStyle1,
    NotificationStyle,

    // TimelineStyle
    TimelineStyle1,
    VideoStyle,

    // Form Components
    ComposeEmailForm,

    // Chat components...
    ChatItem,
    ChatMessage,

};
